import { Stack, Heading, HStack, Text, Input } from "@chakra-ui/react";

const FormInput = (label, placeholder) => {
  return (
    <HStack>
        <Text w='3rem'>{label}</Text>
        <Input placeholder={placeholder} />
    </HStack>
  );
};

export default FormInput;
